import fetch  from 'isomorphic-fetch';

export default async (req, res) => {
    try {
        console.log(req)
        const res1 = await fetch("https://api.mercadolibre.com/sites/MLA/search?q=" + req.q);
        const json = await res1.json();
        res.status(200).json(json)
    } catch (error) {
        res.status(500);
    }
}
